const initialState={
    name:"bipin",
    age:20
}
const EmployeeReducer=(state=initialState,action)=>{
    switch(action.type){
        case "SHOW_EMPLOYEE":
            return{
                ...state,name:action.payload
            }
        // case "ADD_AGE":
        //     return{
        //         ...state,age:action.payload
        //     }
            default:
                return state
    }
}
export default EmployeeReducer
